l Simulation','<p>In the future, the beings from the planet Z-C103 have taken over earth.<br> In order to amuse themselves, they take 3 sets of people: A, B and C and drop them off in an huge enclosed space.<br> At some moments of time two random people meet (all pairs can meet with equal probability), and if they are from different sets, then one person eats the other one to survive, according to this rule: A eats B, B eats C, and C eats A.<br> Determine for each set A, B and C, the probability that this set will be the only one surviving after a long enough period of time.<br></p>','30 25 35','40 35 45','35 35 45','0.356193 0.507122 0.136685','0.404885 0.433692 0.161423','0.515780 0.325007 0.159212',150,'<br>1 &#8804 a,b,c &#8804 100<br>','<p>A single line containing three integers a, b and c(1 &#8804 a,b,c &#8804 100) — the original number of people belonging to sets A, B and C, respectively.<br></p>','<p>Print three space-separated real numbers: the probabilities of sets A, B and C surviving the simulation, respectively. Print answers rounded to 6 decimal places.<br></p>','<br>1 2 2<br>','<br>0.300000 0.550000 0.150000<br>'),(5,1,'Tragedy At Noah\'s','Robbers broke into Noah\'s apartment and stole movie DVDs. <br>\nNoah liked to keep stuff organized. His DVDs were numbered in ascending order\nfrom some integer number z. For example, if z &#61 7 and there were 4 DVDs in the\nhouse, then they had indices 7,8,9,10. <br>\nAfter the robbery, n DVDs remain. Given the indices of these n DVDs, calculate\nthe minimum possible number of DVDs that could have been stolen. <br>','1000\r\n578333 578861 573830 574449 576403 573976 568092 573612 573261 576241 569671 568347 576343 569144 573551 568890 575674 570786 574432 572455 575289 569879 572523 569985 575686 575074 577949 576689 574675 576972 573067 574310 576057 572179 577166 573722 571245 571458 577536 570087 571858 574312 572636 570041 568820 573933 578567 578611 577209 574097 572960 576913 573732 568729 572790 574777 57