the required answer modulo 10^9+7.','4<br>                 8967<br>','3<br>'),(8,2,'Jim vs Dwight','<p>Dwight thinks that he is the smartest guy in the entire office, but Jim doesn\'t agree.</p>\n\n<p>Jim gives Dwight an array of integers. In every move, Dwight can take the maximum from this array and divide it by 2 (integer division).</p>\n\n<p>If after dividing, the number becomes zero, Dwight has to remove it from the list.</p>\n\n<p>Before the start of the game, Jim shows Dwight the numbers in his list.</p>\n\n<p>Jim asks Dwight, <b>M</b> queries. In the <b>i-th</b> query, Dwight is given an integer Q. Dwight must tell Jim the largest number in the array which Dwight will get at the <b>Qth</b> operation, before he divides that number by 2.</p>\n\n<p>Dwight is a bit lost, and he asks you to help. Can you help him?</p>','100 10\r\n434 282 276 256 21 165 178 192 103 349 185 467 416 89 109 461 381 356 104 356 233 78 319 321 44 49 127 366 439 202 63 401 199 311 23 143 236 360 409 281 430 42 341 421 178 2 13 73 15 65 365 344 78 332 334 265 128 16 231 297 97 488 311 474 182 54 9 266 291 40 144 315 289 454 28 394 437 73 497 143 203 494 191 124 63 493 66 219 54 471 14 478 477 291 360 213 438 172 499 393\r\n1\r\n4\r\n10\r\n69\r\n100\r\n101\r\n200\r\n210\r\n211\r\n300','100 10\r\n189 429 234 80 193 488 467 139 26 226 415 350 441 461 22 317 409 256 48 291 391 243 69 276 94 257 52 447 10 342 183 38 42 64 447 279 46 280 174 216 469 20 84 483 113 461 347 165 296 391 347 64 418 189 144 395 473 192 346 353 331 237 468 456 347 138 479 336 500 9 269 274 135 289 372 118 454 362 75 208 252 111 47 80 38 188 174 82 421 58 215 411 416 254 239 396 23 269 99 252\r\n2\r\n4\r\n20\r\n89\r\n200\r\n201\r\n300\r\n310\r\n311\r\n330','100 20\r\n162 321 247 486 332 314 40 154 402 360 58 95 391 434 283 424 317 66 1 331 40 448 90 174 356 368 94 340 439 290 110 220 122 53 33 449 220 237 457 257 168 96 455 383 209 187 170 346 157 458 355 77 271 314 476 253 67 383 199 256 385 200 494 62 500 103 228 23