 to distribute giving him the instruction that everyone should get atleast one.              </p>             <p>               Soham loved chocolates more than anything and tried to keep maximum chocolates to himself but he didn\'t want to be too suspiscious. He realised that his friends will be fine if the friends sitting right next to them have maximum 1 more chocolate than them otherwise they will get angry. Help Soham find the maximum chocolates he can keep for himself.             </p>             <p>                 For eg. Given n is 5,m is 8,i is 3 with 1 based Indexing.                                 <br>Answer will be 2<br>                 He can distribute it as 1 2 2 2 1.             </p>','1000000 914032367 528790','1000000 194818222 998601','100000000 106296029 98572386','30217','18389','2510',50,'<ul>                     <li>1 &#8804 <b>n</b> &#8804 1000000000</li>                     <li>1 &#8804 <b>m</b> &#8804 1000000000</li>                     <li>1 &#8804 <b>k</b> &#8804 n</li>                     </ul>','<ul>                                 <li> Input is just one line with three numbers <b>n,m,i</b>. n is the Number of friends including Soham, m is the Number of chocolates ,i is the Positon of Soham\'s seat. </li>                                  </ul>','<p>Output a single line containing the maximum chocolates Soham can have.</p>','5 8 3','2'),(10,2,'Increased Variety','<p>                Arpan had a toy shop and his shop made toys of 3 kinds. He was going to his friends party so he wanted to bring gifts. Each gift box would comprise three toys but to increase variety he would put atmost 2 of the same kind of toys in a gift box.             </p>             <p>                Given the number of toys of each kind, help Arpan find the maximum number of gift boxes he can bring.             </p>','20\r\n16830 28998 16209\r\n5993 6194 14014\r\n21179 24267 16444\r\n10016 29941 30728\r\n10525 27841 1915\r\n487 5746 29168\r\n11648 3018 29386\r\n280