i>                 </ul>','<p>Output the maximum number of gift boxes he can bring.</p>','1<br>                4 5 5','4<br>'),(11,3,'Nipun\'s Intriguing Challenge','<p>     Nipun thought of a challenge for Ameya. The challenge was as follows. Nipun chose two numbers <b>A</b> and <b>B</b>. From the integer <b>A</b>, Nipun would remove a single digit from <b>A</b> and that would be the value of an integer <b>C</b>. Now Nipun is very confident, so he has allowed you to make any number of transformations to <b>C</b>.<br>     In one transformation you can select 1 digit from <b>A</b> and add it to <b>C</b>(right side). The value of <b>A</b> does not change. Using these transformations, Ameya has to make <b>C</b> a multiple of <b>B</b>(0 is considered to be a multiple of any integer). Assuming Ameya plays optimally, you have to calculate the number of times he is able to do it, when Nipun removes any one of the digits in <b>A</b>.<br>     For example consider A= 112 and B=4 then Nipun can remove \'1\' at 0th position, \'1\' at 1st position(consider both possibilities separately), or \'2\' at 2nd position. Then the starting value of <b>C</b> can be 12, or 11. If it is 12, then it is already a multiple of 4 so Ameya wins without making any moves. If it is 11, then Ameya can win by adding 2, since 112 is divisible by 4. </p>','46\r\ 384\r\ 396\r\ 90\r\ 376\r\n300231874429688777196214143025106372911493863041244389522954222539502604976910773609537868226611763612895926650990628362182009320284310419204242405832834836744936642482580694660523121829 490\r\ 54\r\ 173\r\n205588440454547245524880410137771281309174288719602906672953688836811717769269197518420172290326361891549052551270873170797903654204746155132 38\r\ 173\r\n07949080201626374551899176435832843579180351618647157722436190964021140363626364396363402007368766342365109838121928559 372\r\ 290\r\ 135\r\n166601277177554663685945334526738740256493583732659169030300511564632529041740425165172085466912371802644857539443441974616