tch positions 3 and 4.\n                The switch is not permanent ,i.e. after switching 1 and 3, the next switch is done on the original number itself.\n                 \n            </p>','199\r\n1000110001110000011111111010000011011101001100010011010010000000111011001011101101110010010110011001100001100101001111100110101111111011011100110010111000010000110110011110010100010001011000111101100\r\n1010000110011001000000011111000001010111010001101000000110100011100000000101000010000100000001101110011111111100101010010000110000011100001000011010010111111010001100100001111000011001010110100101000','200\r\n11110010100111010110100010000001001010011001001101010000000010110111101110011010011101010000110110101101010011101110010001000110110011110100101011001101111111111011000011100110010011001110111001101010\r\n00100101110000010001101010100110000111001001011110101011110011101111101000111100110010000111100101110100101111110101000100111000000000101100110000101111011111011100000111110000011111011111000101001101','200\r\n10000010010000110011110001101000111111101010011010001011000010111001010001010001001100000000101001110000011000000100111010110000100101010101111011000110100110010011011101001011001101011010101111101110\r\n00000001001000011111100111001101010111110010001000111011100101010011100110100010011101011111101011111011001011110111000101111100110101000110110111111000110011001101011010101000111111111100001010001101','8266','7280','6883',100,'<ul>                     <li>1 &#8804 <b>N</b> &#8804 500</li>                     </ul>','<ul>                 <li> The first line contains a single integer <b>N</b> denoting the number of digits both the numbers have <b>A</b>.  </li>                 <li>  The second line contains your number of N digits</li>                 <li> The third line contains the number on the door also of N digits</li>                 </ul>','<p>Output a single line containing the password.</p>','4<br>                 1001<br>                 1101<br>','2<br>'),(16,4,'Garv and Rotations','<p><br>Garv loves to play with strings. He takes 2 equal sized(size&equals;<b>N</b>) strings S1 and S2 consisting of lower case latin letters and keeps rotating S2.<br> For example after Garv rotates a string \'wxyz\' once, the new string will be \'xyzw\'. Rotating twice, the new string will be \'yzwx\'. <br>  Garv thinks that 2 strings are friends if there exists a string S such that S is the prefix of both S1 and S2. A longer S means a stronger friendship.<br> Garv wants S1 and S2 to be best friends. Find after how many rotations of S2, the friendship between S1 and S2 is maximum.<br> If you get more than one answer, choose the one that uses minimum rotations.<br></p>','2000\r\\r\','2000\r\\r\','2000\r\\r\','848','905','310',50,'<p><br>1 &le; N &le; 10^6<br></p>','<p><br>The first line of the input contains a single integer N. <br> The second and the third line contains the strings S1 and S2 respectively.<br></p>','<p><br>Print a single integer, minmum number of rotations.<br></p>','<p><br>6<br> abccab<br> cbabcb<br></p>','<br> 2<br>'),(17,4,'Soham still loves chocolates','<p>                Soham and his friends went outside to buy chocolates. Soham wanted to buy <b>N</b> chocolates. He remembered his dads speech on sharing saying \" You have to always give out the greatest factor of the number you buy to your friends,the factor not equal to the number.\" So for eg. if he had 6 chocolates , he should give 3 away.<br>                Soham wanted to follow his dad\'s advice but again also wanted to give away minimum chocolates. He came up with a plan, if he were to buy the chocolates in batches, he could then give away the chocolates individually for each batch, hopefully minimizing the amount given away. He can\'t buy a batch of only one chocolate because then he wasn\'t sure what to do. So he only buys in batches with more than 1 chocolate at a time.             </p>             <p>                 For eg. if he wanted to buy 6 ch