th opinions being labeled \'B\' or \'W\'<br>     Initially each person has an opinion \'B\' or \'W\' but then <b>p</b> rounds of discussion occur.<br>     In each discussion, person <b>i</b> is influenced it\'s left and right neighbour i.e person <b>(i-1)</b> and <b>(i+1)</b> for i from 2 to n-1. 1st person is influenced by n<sup>th</sup> and 2<sup>nd</sup> person, and N<sup>th</sup> person is influenced by (n-1)<sup>th</sup> and 1<sup>st</sup> person<br>     Now for each person i in a discussion, it\'s 2 neighbours and itself are considered. The opinion of ith person changes to the majority of the opinions of it\'s neighbours and itself<br>     For eg, consider \'B\', \'B\', \'W\' to be the opinions of 3 people.<br>     For person 1, the opinion will remain the same, since there are 2 \'B\' opinions and 1 \'W\'. Same goes for person 2, and person 3 will change his opinion to \'B\'<br>     Therefore \'B\', \'B\', \'B\' are the opinions after 1 discussion.(The string is changed after the discussion) </p>','75 274505565\r\nWBWBWBWBBWBWBWBWBWBWBWBBBBWBBBBBWWBWWBWBWBWBWBWBBBBBWWWWWBBBWWWWWBWWWWWBBWB','53 426546319\r\nBBWBBBBBBWBWBBBWBBBBWBBWBWWBWBBBBBBWWWWWBWBWBWWBBBWWW','72 66770349\r\nBWBBBWWWBWWWBWWWBWWWBWBBBBWBWBBWWBWWBBWWWBBWBBWWBBBBWWWBBBBBWWBBWBBBBBWW','BBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBWWWWWWWWWWBBBBBBBBBBWWWWWBBBWWWWWWWWWWWBBBB','BBBBBBBBBBBBBBBBBBBBBBBBWWWWBBBBBBBWWWWWWWWWWWWBBBWWW','WBBBBWWWWWWWWWWWWWWWWBBBBBBBBBBWWWWWBBWWWBBBBBWWBBBBWWWBBBBBWWBBBBBBBBWW',150,'<p><ul>\n    <li>\n        3&le;n&le;100\n    </li>\n    <li>\n        1&le;p&le;10<sup>9</sup>\n    </li>\n</ul><br></p>','<p><ul><li>The first line contains two integers n and p the number of people and the number of discussions, respectively.</li><br>  <li>The second line contains a string consisting of n characters \"B\" and \"W\", representing initial opinions of people</li></ul><br></p>','<p>Print a string consisting of n characters \"W\" and \"B\", representing people\'s opinions after <b>p</b> dis